import React from "react";

const Hello=()=>{
    return(
        <>
        <div className="container-fluid">
        <div className="row">
                <div className="hello">
<h1>HELLO</h1>
                </div>
                </div>
        </div>
        <div className="container-fluid">
        <div className="row">
        <div className="world">
<h1>
    WORLD
</h1>
        </div>
                
                </div>
        </div>
        </>

    );
};
